import React from 'react'
import './App.css'
import Subsection from './Subsection.js'

class Section extends React.Component {
  constructor(props) {
    super(props);
    this.state = { 
      parsedTime: this.parseTimes(this.props.data.time),
  }; }

  parseTimes(data){
    console.log(data);
    for (var key in data) {
      // check if the property/key is defined in the object itself, not in parent
      if (data.hasOwnProperty(key)) {           
          console.log(key, data[key]);
      }
    }

    return "1";
    // return arrToJoin.join(" AND ");
  }

	render() {
		console.log(this.props.data);

		return (
			<React.Fragment>
        <tr>
          <td> {this.props.data.number} </td>
          <td> {this.props.data.instructor} </td>
          <td> {this.props.data.location} </td>
          <td> {this.state.parsedTime} </td>
          <td> <button>Add Section</button> </td>
        </tr>

				{/* subsections */}
				{this.props.data.subsections.map(subsection => (
					<Subsection data={subsection}/>
          ))}

			</React.Fragment>
		)
	}
}

export default Section;
